$(document).ready(function () {

    $(".pj-nav .nav-item").mouseenter(function () {
        var className = this.classList[1];

        $(this).closest('.pj-nav').addClass(className);
        // $(".pj-nav").css("border-top", "2px solid " + color);
    });
    $(".pj-nav .nav-item").mouseleave(function () {
        var className = this.classList[1];
        $(this).closest('.pj-nav').removeClass(className);
    })

    var revertNavTopColor = function () {
        $(".pj-nav--homepage__wrapper").css("border-color", "#B50101");
        $(".pj-nav--politics__wrapper").css("border-color", "#6ec5ff");
        $(".pj-nav--banglore__wrapper").css("border-color", "#bc91db");
        $(".pj-nav--sports__wrapper").css("border-color", "#abd761");
        $(".pj-nav--business__wrapper").css("border-color", "#8383eb");
        $(".pj-nav--entertainment__wrapper").css("border-color", "#72ccd4");
        $(".pj-nav--feel__wrapper").css("border-color", "#a16c72");
        $(".pj-nav--columns__wrapper").css("border-color", "#bcc47a");
        $(".pj-nav--earth__wrapper").css("border-color", "#fc9494");
        $(".pj-nav--connection__wrapper").css("border-color", "#e37fae");
        $(".pj-nav--focus__wrapper").css("border-color", "#ffc569");
        $(".pj-nav--events__wrapper").css("border-color", "#fad75a");
    }
    revertNavTopColor();

    //active current link as per page//
    $(function () {
        var current = window.location.pathname.replace(/^\/([^\/]*).*$/, '$1');
        $('.navbar-nav .nav-link').each(function () {
            var $this = $(this);
            // if the current path is like this link, make it active
            if ($this.attr('href').indexOf(current) !== -1 && current.length !== 0) {
                $this.parent().addClass('active');
            }
        })
    });

    // Trigger Primary Dropdown on Mobile
    $(".pj-header__menu-toggler").click(function () {
        $(".pj-primary-dropdown").fadeIn();
    });

    // Mobile Primary Dropdown - Close Button Interaction
    $(".pj-primary-dropdown__close-btn").click(function () {
        $(".pj-primary-dropdown").fadeOut();
    });

    $(".pj-nav--hamburger").click(function () {
        $(".pj-primary-dropdown").fadeIn();
    });

    // // Signup Modal Login link interaction
    // $(".pj-login-link").click(function(){
    //     $("#signupModal").modal('hide');
    //     $("#signinModal").modal('show');
    // });

    // // Signin Modal Signup link interaction
    // $(".pj-signup-link").click(function(){
    //     $("#signinModal").modal('hide');
    //     $("#signupModal").modal('show');
    // });

    var element = $(".stickyNav");
    var offsettopvaluofstickyad = $(element).offset().top;
    window.onscroll = function () {
        var navBar = $(element).find('.navbar-nav');
        arr = $(navBar).find('li');
        Array.from(arr)
        if (window.pageYOffset >= offsettopvaluofstickyad) {
            $(element).addClass("stickyOnTop");
            $(".pj-logo-link").css({
                'display': 'block',
            });
            $(arr).slice(-3, 13).css({
                'display': 'none'
            });
        } else {
            $(element).removeClass("stickyOnTop");
            $(".pj-logo-link").css({
                'display': 'none',
            });
            $(arr).slice(-3, 13).css({
                'display': 'block'
            });
        }
    }

});
